const env = process.env.NODE_ENV || 'development'
const debug = env !== 'production'

const config = {
  devtool: debug ? 'cheap-module-source-map' : 'hidden-source-map',
  entry: {
    vendor: ['vue','vuex','vue-router'],
    bundle: './src/index'
  },
